import React, {Component} from 'react';
import ParticleWrapper from './ParticleWrapper';

class Events extends Component {
    render() {
        return (
            <div className="mainbody">
                <h1>
                    Events
                </h1>
                <ParticleWrapper />
            </div>
        );
    }
}

export default Events;
